<html xmlns="http://www.w3.org/1999/xhtml">
<head>
<style>
	html,body 	{
    margin:0 auto; 
    width:100%;
    text-align:center;
    }
	table {
    border-collapse: collapse;
	}
	
	div.inline { float:left; }
	.clearBoth { clear:both; }
	div { display:inline-block; }
      /* IE6-7 */
      @media,
          {
          div { display: inline; margin-right:10px; }
          }

	body {
	margin: 0px;
	padding: 0px;
	}
 
table, td, th {
	margin: 0px;
    border: 1px solid black;
}

table {
    border-collapse: collapse;
	align: center;
}

th, td {
    padding: 4px;
    text-align: center;
    border-bottom: 1px solid #ddd;
}

th {
	font-size: 90%;
    background-color: #000000;
    color: white;
    border-top: none;
}

tr:hover {background-color:#016daf;}
td:hover {background-color:#6c76c1;}
th:hover {background-color:#ff76ff;}
tr:nth-child(even) {background-color: #debecf;}

table {
	font-size: 80%;
    border-collapse:separate;
    border:solid black 1px;
    border-radius:6px;
    -moz-border-radius:6px;
    border: 0px;
	margin: 0px;
	padding: 0px;
}

td, th {
	border: 0px;
	margin: 0px;
	padding: 0px;
    border-left:solid black 1px;
    border-top:solid black 1px;
}

td:first-child, th:first-child {
     border-left: none;
}

.wrap {  padding: 0; overflow: hidden; }
iframe { border: 1px solid black; }

iframe:focus {
    outline: none;
}

iframe[seamless] {
    display: block;
}

iframe {
		border: 0px;
		margin: 0px;
		padding: 0px;
        -ms-zoom: 0.66;
        -moz-transform: scale(0.66);
        -moz-transform-origin: 0 0;
        -o-transform: scale(0.66);
        -o-transform-origin: 0 0;
        -webkit-transform: scale(0.66);
        -webkit-transform-origin: 0 0;
        border-spacing: 1px; 
    }
div {
		left: 0px;
		right: 0px;
        
	}
html, body {
  border: 0px;
  margin: 0px;
  padding: 0px;
}
table { border-spacing: 0px; } /* cellspacing */

th, td { padding: 1px; } /* cellpadding */


</style>
